import React from "react";
import {Route, Routes } from "react-router-dom";
import StateTest from "./state/stateTest";

function RoutesSample() {
    return(
        <Routes>
            <Route
                path="/stateTest"
                element={<StateTest/>}
            />
        </Routes>
    )
}

export default RoutesSample;
